import { useEffect, useState } from "react"

interface User {
    firstname: string;
    lastname: string;
}

const useUser = () => {

    const [user, setUser] = useState<User>({firstname: '', lastname: ''})


    useEffect(() => {
        login().then((response) => {
            setUser(response)
        })
    })
    const login = () => {
        return new Promise<User>((resolve, reject) => resolve({firstname: 'John', lastname: 'Doe'}))
    }

    return {user}
}

export default useUser;
